			},
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = 0,
			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/AntorusAchievements/6",
			["actions"] = {
				["start"] = {
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "aura_env.debug = false\n\naura_env.bossUnit = {}\naura_env.GetBossInfo = function()\n    aura_env.bossUnit = {}\n    for i = 1,5 do\n        local unit = \"boss\"..i\n        if UnitExists(unit) then\n            local GUID = UnitGUID(unit)\n            local NPCID = select(6, strsplit(\"-\", GUID))\n            aura_env.bossUnit[tonumber(NPCID)] = unit\n        end\n    end\nend\n\naura_env.lastPower = 0\n\n--Option 1: once you pick up an orb, a 5s timer starts. \n--if you collect 20 orbs in time, you complete the achievement. \n--if you collected the first orb early, but then collect 20 orbs in time, \n--but the timer runs out inbetween, you won't get the achievement.\naura_env.option1done = false\naura_env.startTimer = nil\naura_env.startPower = nil\n\n--Option 2: there is no timer, but just a shifting timewindow.\n--so if you collect 20 orbs in any 5s window of time, you get the achievement.\n--this would be far more lenient, but is unlike other similar achievements.\naura_env.option2done = false\naura_env.pool = 0\n\n\n\n",
					["do_custom"] = true,
				},
			},
			["useTooltip"] = true,
			["keepAspectRatio"] = false,
			["selfPoint"] = "CENTER",
			["trigger"] = {
				["spellId"] = "243963",
				["names"] = {
					"Sweeping Scythe", -- [1]
				},
				["use_sourceFlags"] = false,
				["debuffType"] = "HARMFUL",
				["type"] = "custom",
				["subeventPrefix"] = "SPELL",
				["unevent"] = "timed",
				["unit"] = "player",
				["custom_hide"] = "custom",
				["event"] = "Combat Log",
				["custom"] = "function(event)\n    local aura_env = aura_env\n    if event == \"UNIT_POWER\" then\n        if aura_env.bossUnit[125886] then\n            local power = UnitPower(aura_env.bossUnit[125886])\n            local gain = power - aura_env.lastPower\n            \n            if aura_env.debug then print(string.format(\"gain: %d\", gain)) end\n            \n            if gain > 0 then --only if the power goes up, we got an orb\n                --Option 1\n                if not aura_env.option1done then --check if this option is completed already\n                    local time = GetTime()\n                    if not aura_env.startTimer then --if there is no timer going, start one and remember the power it started with\n                        aura_env.startTimer = time\n                        aura_env.startPower = aura_env.lastPower\n                        \n                        if aura_env.debug then print(string.format(\"O1: timer started with %d at %.3f\", aura_env.startPower, aura_env.startTimer)) end\n                        \n                        C_Timer.After(5, --after 5s the timer is expired and we nil everything\n                            function()\n                                aura_env.startTimer = nil \n                                aura_env.startPower = nil\n                                if aura_env.debug then print(string.format(\"O1: timer ended\")) end\n                            end\n                        )\n                    elseif time - aura_env.startTimer < 5 and power - aura_env.startPower >= 80 then --if the timer is not expired yet and we gained at least 80 power, we did it\n                        if aura_env.debug then print(string.format(\"O1: completed with %d after %.3f\", (power - aura_env.startPower), (time - aura_env.startTimer))) end\n                        \n                        SendChatMessage(\"{rt1} Achievement criteria fulfilled! Kill the boss! {rt1}\" ,\"RAID\")\n                        aura_env.option1done = true\n                    end\n                end\n                \n                --Option 2                \n                if not aura_env.option2done then --check if this option is completed already\n                    aura_env.pool = aura_env.pool + gain --add gain to the pool\n                    \n                    if aura_env.debug then print(string.format(\"O2: added %d to the pool, new total %d\", gain, aura_env.pool)) end\n                    \n                    C_Timer.After(5, --after 5s remove the previous gain from the pool\n                        function() \n                            aura_env.pool = aura_env.pool - gain \n                            if aura_env.debug then print(string.format(\"O2: removed %d from the pool, new total %d\", gain, aura_env.pool)) end\n                        end\n                    )\n                    if aura_env.pool >= 80 then --should the pool ever be greater than or equal to 80, we did it\n                        if aura_env.debug then print(string.format(\"O2: completed with a total of %d\", aura_env.pool)) end\n                        \n                        SendChatMessage(\"{rt2} Achievement criteria fulfilled! Kill the boss! {rt2}\" ,\"RAID\")\n                        aura_env.option2done = true\n                    end\n                end\n            end\n            \n            aura_env.lastPower = power --update the power (even for losses, so we get accurate gains)\n            return true\n        end\n    elseif event == \"INSTANCE_ENCOUNTER_ENGAGE_UNIT\" then\n        aura_env.GetBossInfo() --update boss info table when boss frames change\n    end\nend",
